import React from "react";
import data from "../Data/daily_json.json";

const DataFetch = () => {
  const originalData = data;
  let dataPrice = [];
  originalData.forEach(function(price) {
    dataPrice.push(price.id);
  });

  return (
    <div>
      <DataFetch />
    </div>
  );
};
export default DataFetch;
